    #     return False

    def increasingTriplet(self, nums):
        k = 3
        targets = [float('inf')] * (k-1)
        for n in nums:
            flag = False
            for i in range(k-1):
                if n <= targets[i]:
                    targets[i] = n
                    flag = True
                    break

            if not flag:
                return True

        return False



